package io.github.aungkothet.padc.assignment11.data.vosimport androidx.room.Embeddedimport com.google.gson.annotations.SerializedNameimport io.github.aungkothet.padc.assignment11.data.vos.ProfileImageVOdata class UserVO(    @SerializedName("id")    var id: String,    @SerializedName("name")    var name: String,    @SerializedName("username")    var userName: String,    @SerializedName("portfolio_url")    var photoUrl: String?,    @SerializedName("profile_image")    @Embedded(prefix = "profile_image_")    var profileImageVO: ProfileImageVO?)